import{_ as c,a,b as t,c as i,d as h,e,f as l,g as r,h as n,i as m,j as d,k as o,l as s,m as p,n as u,o as _,p as g,q as f,r as b,s as k,t as q,u as v,v as P,w as F,x as R,y as I,z as x,A as S,B as D,C as w}from"./chunks/logged_messages.BLmINYgI.js";import{_ as T,c as A,o as y,ab as G}from"./chunks/framework.CUflZczI.js";const j=JSON.parse('{"title":"Flight Review를 이용한 로그 분석","description":"","frontmatter":{},"headers":[],"relativePath":"ko/log/flight_review.md","filePath":"ko/log/flight_review.md"}'),O={name:"ko/log/flight_review.md"},z=G('<h1 id="flight-review를-이용한-로그-분석" tabindex="-1">Flight Review를 이용한 로그 분석 <a class="header-anchor" href="#flight-review를-이용한-로그-분석" aria-label="Permalink to &quot;Flight Review를 이용한 로그 분석&quot;">​</a></h1><p><a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> 는 기체 상태 점검에 사용할 수 있습니다.</p><p>그래프 자체는 어렵지 않지만, 허용 범위와 적절한 그래프 모양을 파악하기 위해서는 약간의 경험이 필요합니다. 이 페이지에서는 그래프를 해석하고 문제점을 식별하는 방법을 설명합니다.</p><h2 id="일반적인-사용법" tabindex="-1">일반적인 사용법 <a class="header-anchor" href="#일반적인-사용법" aria-label="Permalink to &quot;일반적인 사용법&quot;">​</a></h2><p>그래프에 공통적인 기능 :</p><ul><li>그래프의 배경색은 기록 중 비행 모드를 나타내는 데 사용됩니다 (그래프는 모드에 따라 다름).<img src="'+c+'" alt="비행 모드"><ul><li><strong>비행 모드 :</strong> 그래프 본문의 배경색은 비행 모드를 나타냅니다. 그래프 위로 마우스를 가져 가면 비행 모드 레이블이 표시됩니다.</li><li><strong>VTOL flight mode:</strong> VTOL vehicles additionally show the VTOL mode as background colour in the bottom part of the plot (blue for multicopter, yellow for fixed-wing, and red for transition).</li></ul></li><li>특정 그래프 축을 마우스로 스크롤 하면 해당 축이 확대됩니다 (수평 또는 수직).</li><li>그래프 내에서 마우스를 스크롤 하면 두 축이 모두 확대됩니다.</li></ul><p><a id="tracking"></a></p><h2 id="pid-추적-성능" tabindex="-1">PID 추적 성능 <a class="header-anchor" href="#pid-추적-성능" aria-label="Permalink to &quot;PID 추적 성능&quot;">​</a></h2><p>비행 모드에 따라 비행 컨트롤러는 위치, 속도, 고도 또는 속도 설정 값을 추적할 수 있습니다 (추적된 설정 값은 모드에 따라 다릅니다. 예 : 안정화 모드에서는 속도 설정 값이 없음).</p><p><strong>예상</strong> 라인 (빨간색)은 <strong>설정 값</strong> (녹색)과 거의 일치하여야 합니다. 그렇지 않은 경우 대부분의 경우 해당 컨트롤러의 PID 게인을 조정해야합니다.</p><p><a href="./../config_mc/pid_tuning_guide_multicopter.html">멀티콥터 PID 튜닝 가이드</a>에는 추적 성능 분석에 대한 예제 플롯과 정보가 포함되어 있습니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>특히 속도 컨트롤러의 경우 확대 할 때 더 자세한 정보를 얻으려면 고속 로깅 프로필 (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>)을 활성화하는 것이 유용합니다.</p></div><h2 id="진동" tabindex="-1">진동 <a class="header-anchor" href="#진동" aria-label="Permalink to &quot;진동&quot;">​</a></h2><p>진동은 멀티콥터의 가장 일반적인 문제중 하나입니다. 높은 진동은 아래의 결과들을 초래할 수 있습니다.</p><ul><li>비효율적인 비행과 비행 시간 감소</li><li>모터가 가열될 수 있습니다.</li><li>재료들의 마모 증가</li><li>기체을 단단히 고정할 수 없어, 비행 성능이 저하됩니다.</li><li>센서 클리핑</li><li>위치 추정 실패로 인하여 잠재적으로 오비행이 발생할 수 있습니다.</li></ul><p>따라서 진동 수준을 주시하고 필요한 경우 설정을 개선하여야 합니다.</p><p>진동이 너무 높은 시점이 있으며, 일반적으로 진동은 낮을수록 좋습니다. 그러나 &#39;모든 것이 정상&#39;과 &#39;레벨이 너무 높습니다&#39; 사이에는 넓은 범위가 있습니다. 이 범위는 기체 크기를 포함한 여러 요인에 따라 달라집니다. 대형 기체는 더 높은 관성을 갖고 더 많은 소프트웨어 필터링을 허용합니다 (동시에 대형 차량의 진동은 더 낮은 주파수임).</p><p>다음 섹션에서는 진동 수준을 확인에 사용할 그래프와 분석 방법을 설명합니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>진동을 분석시에는 여러 차트를 살펴 보는 것이 좋습니다 (다른 차트가 일부 문제를 더 잘 강조할 수 있음).</p></div><h3 id="액추에이터-fft-제어" tabindex="-1">액추에이터 FFT 제어 <a class="header-anchor" href="#액추에이터-fft-제어" aria-label="Permalink to &quot;액추에이터 FFT 제어&quot;">​</a></h3><div class="info custom-block"><p class="custom-block-title">You need to enable the high-rate logging profile (<a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>) to see this plot.</p></div><p>이 그래프는 액추에이터 제어 신호 (속도 컨트롤러의 PID 출력)를 기반으로 롤, 피치 및 요 축에 대한 주파수 플롯을 보여줍니다. 주파수 피크를 식별하고 소프트웨어 필터를 구성하는 데 도움이됩니다. 가장 낮은 끝 (약 20Hz 미만)에는 단일 피크 만 있어야하며 나머지는 낮고 평평하여야 합니다.</p><p>y 축 스케일링은 기체마다 다르지만, 동일한 기체의 로그를 서로 직접 비교할 수 있습니다.</p><h4 id="예-양호한-진동" tabindex="-1">예: 양호한 진동 <a class="header-anchor" href="#예-양호한-진동" aria-label="Permalink to &quot;예: 양호한 진동&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5 &quot;Racer</a> 프레임 (양호한 진동).</p><p><img src="'+a+'" alt="저진동 QAV-R 5 Racer - FFT 그래프"></p><div class="info custom-block"><p class="custom-block-title">The excellent vibration characteristics of the above frame mean that we can considerably increase the cutoff frequency of the <a href="./../config_mc/filter_tuning.html">software filters</a> (reducing control latency).</p></div><p>DJI F450 프레임(양호한 진동).</p><p><img src="'+t+'" alt="저진동 DJI F450 - FFT 그래프"></p><p>S500 프레임:</p><p><img src="'+i+'" alt="저진동 S500 액추에이터 컨트롤 - FFT 플롯"></p><div class="info custom-block"><p class="custom-block-title">While the plot above looks good, the <a href="#raw_acc_s500">Raw Acceleration graph for the same flight</a> shows that the vibration levels are a bit high for x and y. 이것은 여러 그래프를 확인할 가치가 있는 이유에 대한 좋은 예입니다!</p></div><h4 id="예-불량-진동" tabindex="-1">예: 불량 진동 <a class="header-anchor" href="#예-불량-진동" aria-label="Permalink to &quot;예: 불량 진동&quot;">​</a></h4><p>이 예는 50Hz에 가까운 주파수의 피크를 보여줍니다 (이 경우 &quot;느슨한&quot;랜딩 기어로 인해).</p><p><img src="'+h+'" alt="랜딩 기어의 진동 - FFT 플롯"></p><h3 id="가속-전력-스펙트럼-밀도" tabindex="-1">가속 전력 스펙트럼 밀도 <a class="header-anchor" href="#가속-전력-스펙트럼-밀도" aria-label="Permalink to &quot;가속 전력 스펙트럼 밀도&quot;">​</a></h3><p>이것은 시간에 따른 원시 가속도계 데이터의 주파수 응답을 보여주는 2D 주파수 플롯입니다 (x, y 및 z 축의 합계를 표시함). 노란색 영역이 많을수록 해당 시간 및 주파수에서 주파수 응답이 높아집니다.</p><p>이상적으로는 몇 Hz까지의 가장 낮은 부분만 노란색이고 나머지는 대부분 녹색 또는 파란색입니다.</p><h4 id="예-양호한-진동-1" tabindex="-1">예: 양호한 진동 <a class="header-anchor" href="#예-양호한-진동-1" aria-label="Permalink to &quot;예: 양호한 진동&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5 &quot;Racer</a> 프레임 (양호한 진동).</p><p><img src="'+e+'" alt="저진동 QAV-R 5 Racer - 스펙트럼 밀도 플롯"></p><p>DJI F450 프레임(양호한 진동).<img src="'+l+'" alt="저진동 DJI F450 - 스펙트럼 밀도 플롯"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Above you can see the blade passing frequency of the propellers at around 100 Hz.</p></div><p>S500 프레임:<img src="'+r+'" alt="저진동 S500 - 스펙트럼 밀도 플롯"></p><h4 id="예-불량-진동-1" tabindex="-1">예: 불량 진동 <a class="header-anchor" href="#예-불량-진동-1" aria-label="Permalink to &quot;예: 불량 진동&quot;">​</a></h4><p>약 100Hz의 강한 노란색 선은 추가 조사가 필요한 잠재적인 문제를 나타냅니다 (다른 차트 검토부터 시작).</p><p><img src="'+n+'" alt="높은 진동 스펙트럼 밀도 그래프 "></p><p>이 그래프는 50Hz에 가까운 주파수의 피크를 보여줍니다 (이 경우 &quot;느슨한&quot;랜딩 기어로 인해).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>이것은 기체 역학에 가까운 강력한 단일 저주파이기 때문에 가능한 문제를 나타냅니다. 기본 필터 설정인 80Hz 진동은 50Hz에서 필터링되지 않습니다.</p></div><p><img src="'+m+'" alt="랜딩 기어의 진동 - 스펙트럼 밀도 플롯"></p><p>매우 높은 (안전하지 않은) 진동! 그래프는 거의 완전히 노란색입니다.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>높은 진동 수준으로 비행하여서는 안됩니다.</p></div><p><img src="'+d+'" alt="매우 높은 진동 스펙트럼 밀도 그래프 "></p><h3 id="원시-가속" tabindex="-1">원시 가속 <a class="header-anchor" href="#원시-가속" aria-label="Permalink to &quot;원시 가속&quot;">​</a></h3><p>이 그래프는 x, y 및 z 축에 대한 원시 가속도계 측정을 보여줍니다. 이상적으로 각 선은 가늘고 기체의 가속도를 보여줍니다.</p><p>경험상 z 축 그래프가 호버링 또는 느린 비행 중에 x/y 축 그래프에 닿으면, 진동 수준이 너무 높은 것입니다.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>이 그래프를 사용하는 가장 좋은 방법은 차량이 호버링하는 부분을 약간 확대하는 것입니다.</p></div><h4 id="예-양호한-진동-2" tabindex="-1">예: 양호한 진동 <a class="header-anchor" href="#예-양호한-진동-2" aria-label="Permalink to &quot;예: 양호한 진동&quot;">​</a></h4><p><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5 &quot;Racer</a> 프레임 (양호한 진동).</p><p><img src="'+o+'" alt="저진동 QAV-R 5 Racer - 원시 가속도. 그래프"></p><p>DJI F450 프레임(양호한 진동).<img src="'+s+'" alt="저진동 DJI F450 - 원시 가속도 그래프"></p><h4 id="예-불량-진동-2" tabindex="-1">예: 불량 진동 <a class="header-anchor" href="#예-불량-진동-2" aria-label="Permalink to &quot;예: 불량 진동&quot;">​</a></h4><p><a id="raw_acc_s500"></a> S500 프레임. 경계선 진동 수준-x 및 y에 대해 약간 높음 (S500 기체의 경우 일반적임). 이것은 비행 성능에 부정적인 영향을 미치기 시작하는 한계입니다.</p><p><img src="'+p+'" alt="경계선 진동 S500 x, y - 원시 가속도. 그래프"></p><p>너무 강한 진동 z 축의 그래프가 x/y 축 그래프와 어떻게 겹치는 지 확인하십시오.</p><p><img src="'+u+'" alt="랜딩 기어의 진동 - 원시 가속도. 그래프"></p><p>진동 수준이 너무 높습니다. z 축의 그래프가 x/y 축 그래프와 어떻게 겹치는 지 확인하십시오.</p><p><img src="'+_+'" alt="원시 가속도에서 높은 진동. 그래프"></p><p>매우 높은 (안전하지 않은) 진동 수준.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>높은 진동 수준으로 비행하여서는 안됩니다.</p></div><p><img src="'+g+'" alt="원시 가속에서 매우 높은 진동. 그래프"></p><p><a id="fifo_logging"></a></p><h3 id="원시-고속-imu-데이터-플롯" tabindex="-1">원시 고속 IMU 데이터 플롯 <a class="header-anchor" href="#원시-고속-imu-데이터-플롯" aria-label="Permalink to &quot;원시 고속 IMU 데이터 플롯&quot;">​</a></h3><p>심층 분석을 위해 원시 IMU 데이터를 전체 속도 (IMU에 따라 몇 kHz)로 기록하는 옵션이 있습니다. 이를 통해 일반 로깅보다 훨씬 더 높은 주파수를 검사할 수 있으므로 진동 마운트를 선택하거나 저역 통과 및 노치 필터를 적절하게 구성시에 도움이 될 수 있습니다.</p><p>이를 사용하려면 일부 매개 변수를 변경하여야 합니다.</p><ul><li><a href="./../advanced_config/parameter_reference.html#IMU_GYRO_RATEMAX">IMU_GYRO_RATEMAX</a>를 400으로 설정합니다. 이렇게하면 원시 센서 데이터가 센서에서 시스템의 나머지 부분으로 전송될 때보다 효율적으로 압축되고 로그 크기가 줄어듭니다 (유용한 데이터를 줄이지 않고). </li><li>IMU 데이터에는 높은 로깅 대역폭이 필요하므로, 좋은 SD 카드를 사용하여야 합니다(로깅 속도가 너무 높으면 Flight Review에서 드롭 아웃이 표시됨).</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>많이 사용하는 SD 카드를 비교하려면 <a href="./../dev_log/logging.html#sd-cards">로깅&gt; SD 카드</a>를 참조하세요.</p></div><ul><li><a href="./../advanced_config/parameter_reference.html#SDLOG_PROFILE">SDLOG_PROFILE</a>에서 자이로 또는 가속 고속 FIFO 프로필을 활성화하고 나머지 항목은 비활성화 합니다. 정말 좋은 SD 카드를 사용하면 (드롭 아웃이 적거나 없음) 다음 작업을 수행 할 수 있습니다. <ul><li>가속 및 자이로 프로필 모두 활성화</li><li>또는 가속/자이로와 기본 로깅 프로필을 활성화합니다.</li></ul></li></ul><p>그래프 예:</p><p><img src="'+f+'" alt="고속 가속 전력 스펙트럼 밀도"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Data of the first IMU is logged, which is not necessarily the same as the one used for flying. :::note 첫 번째 IMU의 데이터가 기록되며, 비행에 사용되는 데이터와 반드시 동일하지는 않습니다.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Do not forget to restore the parameters after testing.</p></div><p><a id="solutions"></a></p><h3 id="진동-문제-해결" tabindex="-1">진동 문제 해결 <a class="header-anchor" href="#진동-문제-해결" aria-label="Permalink to &quot;진동 문제 해결&quot;">​</a></h3><p>진동의 원인(또는 여러 원인의 조합)을 로그만으로는 알 수 없는 경우가 많이 있습니다.</p><p>이러한 경우에는 기체를 검사하여야 합니다. <a href="./../assembly/vibration_isolation.html">진동 방지</a>은 진동을 줄이기 위하여 확인할 수있는 (및 수행 할) 몇 가지 기본적인 사항들에 대하여 설명합니다.</p><h2 id="액추에이터-출력" tabindex="-1">액추에이터 출력 <a class="header-anchor" href="#액추에이터-출력" aria-label="Permalink to &quot;액추에이터 출력&quot;">​</a></h2><p><em>액추에이터 출력</em> 그래프는 개별 액추에이터 (모터/서보)로 전송되는 신호를 나타냅니다. 일반적으로 최소 및 최대 구성된 PWM 값 사이의 범위입니다 (예 : 1000 ~ 2000).</p><p>다음은 정상적인 쿼드로터의 예입니다 (모든 신호가 범위 내에 있고, 서로 거의 겹치며, 너무 시끄럽지 않음).<img src="'+b+'" alt="우수한 액추에이터 출력"></p><p>그래프 여러가지 문제점을 식별에 매우 유용합니다.</p><ul><li><p>하나 이상의 신호가 오랜 시간에 걸쳐 최대 값에 도달하면 컨트롤러가 <strong>포화</strong>에 도달 함을 의미합니다. 예를 들어, 최대 출력 비행시 예상되는 문제점은 아닙니다. 그러나, 예를 들어 임무중에 발생하는 것은 기체가 제공할 수있는 추력의 양에 비해 과체중임을 나타냅니다.</p></li><li><p>멀티콥터의 경우 그래프는 기체는 <strong>불균형</strong>인 경우 좋은 표시가 될 수 있습니다. 그래프에서 하나 이상의 인접 모터(쿼드 로터의 경우 2 개)가 평균적으로 더 높은 추력으로 작동해야 함을 보여줍니다. 일부 모터가 다른 모터보다 더 많은 추력을 제공하거나 ESC가 보정되지 않은 경우에도 마찬가지입니다. 불균형 차량은 일반적으로 자동 조종 장치가 자동으로 설명하므로 큰 문제는 아닙니다. 그러나, 최대 달성 가능한 추력을 줄이고 일부 모터에 더 많은 부담을 주므로 기체의 균형을 맞추는 것이 좋습니다.</p></li><li><p>요 축에서도 불균형이 발생할 수 있습니다. 그래프는 이전 사례와 비슷하게 보이지만 반대 모터는 각각 더 높거나 낮게 작동합니다. 원인은 하나 이상의 모터가 기울어 졌기 때문일 수 있습니다.</p><p>다음은 헥사 로터의 예입니다. 모터 1, 3, 6은 더 높은 추력으로 작동합니다.<img src="'+k+'" alt="Hexrotor imbalanced actuator outputs"></p></li><li><p>신호가 <strong>잡음</strong>이 심한 (진폭이 높음) 경우에는 두 가지 원인이 있을 수 있습니다. 컨트롤러를 통과하는 센서 노이즈 또는 진동 (다른 플롯에도 표시됨, 이전 섹션 참조) 또는 PID 이득이 너무 높은 경우 입니다. 이것은 극단적인 경우의 예입니다. <img src="'+q+'" alt="시끄러운 액추에이터 출력 - 극단적 인 경우"></p></li></ul><h2 id="gps-불확실성" tabindex="-1">GPS 불확실성 <a class="header-anchor" href="#gps-불확실성" aria-label="Permalink to &quot;GPS 불확실성&quot;">​</a></h2><p>그래프 여러가지 문제점을 식별에 매우 유용합니다.</p><ul><li>사용된 위성 수 (약 12 개 이상이어야 함)</li><li>수평 위치 정확도 (1 미터 미만이어야 함)</li><li>수직 위치 정확도 (2 미터 미만이어야 함)</li><li>GPS 수정 : 3D GPS 수정의 경우 3, GPS + Dead Reckoning의 경우 4, RTK 플로트의 경우 5, RTK 고정 유형의 경우 6입니다.</li></ul><h2 id="gps-잡음과-방해-전파" tabindex="-1">GPS 잡음과 방해 전파 <a class="header-anchor" href="#gps-잡음과-방해-전파" aria-label="Permalink to &quot;GPS 잡음과 방해 전파&quot;">​</a></h2><p>GPS 노이즈와 방해 전파 그래프로 GPS 신호 간섭 및 방해 전파를 확인할 수 있습니다. GPS 신호는 매우 약하므로 GPS에서 사용하는 주파수를 사용하는 (케이블을 통해) 부품으로 인하여 방해를 받기 쉽습니다.</p><div class="tip custom-block"><p class="custom-block-title">USB</p><p>3 is <a href="https://www.usb.org/sites/default/files/327216.pdf" target="_blank" rel="noreferrer">known to be</a> an effective GPS jamming source.</p></div><p><strong>방해 표시기</strong>는 약 40 이하이어야 합니다. 약 80 이상의 값은 너무 높으므로 설정을 검사하여야 합니다. 신호 간섭은 정확도가 떨어지고 GPS 수정이 불가능한 지점까지 위성 수가 적기 때문에 현저하게 나타납니다.</p><p>이것은 간섭이없는 예입니다.</p><p><img src="'+v+'" alt="GPS 방해 - 좋은 그래프"></p><h2 id="추력-및-자기장" tabindex="-1">추력 및 자기장 <a class="header-anchor" href="#추력-및-자기장" aria-label="Permalink to &quot;추력 및 자기장&quot;">​</a></h2><p><em>추력 및 자기장</em> 그래프는 자기 센서 측정 벡터의 추력과 표준을 나타냅니다.</p><p>표준은 전체 비행에 걸쳐 일정해야하며 추력과 관련이 없어야합니다. 이것은 표준이 상수에 매우 가까운 좋은 예입니다. <img src="'+P+'" alt="상수에 가까운 추력과 자기장"></p><p><em>상관 관계가 있는 경우</em> 모터 (또는 다른 소비자)에서 끌어온 전류가 자기장에 영향을 미치고 있음을 의미합니다. 이것은 부정확한 요 추정으로 이어지므로 피해야 합니다. 다음 플롯은 자력계의 추력과 표준 사이의 강한 상관 관계를 나타냅니다. <img src="'+F+'" alt="추력 및 자기장의 상관성"></p><p>이에 대한 해결책은 다음과 같습니다:</p><ul><li>외부 자력계를 사용하십시오 (내부 자력계는 사용하지 마십시오).</li><li>외부 자력계를 사용하는 경우 강한 전류에서 먼 곳에 장착하여야 합니다.(예 : 더 긴 GPS 마스트 사용).</li></ul><p>표준이 상관 관계가 없지만 일정하지 않은 경우 제대로 보정되지 않았을 가능성이 높습니다. 그러나, 외부 방해로 인한 것일 수도 있습니다 (예 : 금속 구조물 가까이에서 비행 할 때).</p><p>이 예는 표준이 일정하지 않지만 추력과 관련이 없음을 보여줍니다.<img src="'+R+'" alt="추력 및 자기장의 비상관성"></p><h2 id="estimator-watchdog" tabindex="-1">Estimator Watchdog <a class="header-anchor" href="#estimator-watchdog" aria-label="Permalink to &quot;Estimator Watchdog&quot;">​</a></h2><p><em>Estimator Watchdog</em> 플롯은 추정기의 상태 보고서를 보여줍니다. 상수 0 이어야합니다.</p><p>문제가 없는 경우 다음과 같이 표시됩니다.<img src="'+I+'" alt="Estimator Watchdog - 양호"></p><p>플래그 중 하나가 0이 아니면 추정기는 조사가 필요한 문제를 감지한 것입니다. 대부분의 경우 이것은 자력계 간섭과 같은 센서의 문제입니다. 일반적으로 해당 센서의 플롯을 보면 도움이 됩니다.</p><p>다음은 자력계 문제가 있는 경우의 예입니다.<img src="'+x+'" alt="자력계 문제가 있는 Estimator watchdog"></p><h2 id="센서-데이터의-샘플링-규칙" tabindex="-1">센서 데이터의 샘플링 규칙 <a class="header-anchor" href="#센서-데이터의-샘플링-규칙" aria-label="Permalink to &quot;센서 데이터의 샘플링 규칙&quot;">​</a></h2><p>샘플링 규칙 그래프는 로깅 시스템 및 스케줄링 문제에 대한 통찰력을 제공합니다.</p><p>샘플링 규칙 그래프는 로깅 시스템 및 스케줄링 문제에 대한 통찰력을 제공합니다.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Occasional dropouts can be expected on medium quality cards.</p></div><p><strong>델타 t</strong>는 로깅된 두 IMU 샘플 간의 시간 차이를 보여줍니다. 데이터 게시 속도가 250Hz이므로 4ms에 가까워야 합니다. 그 배수의 스파이크가 있는 경우 (추정기 타임 슬립이 증가하지 않음) 이는 로거가 일부 샘플을 건너 뛴 것을 의미합니다. 로거가 낮은 우선 순위로 실행되기 때문에 가끔 이런 현상이 발생할 수 있습니다. 배수가 아닌 스파이크가 있는 경우 조사해야하는 불규칙한 센서 드라이버 스케줄링을 나타냅니다.</p><p><strong>추정기 타임 슬립</strong>은 현재 시간과 해당 시간까지의 통합 센서 간격 시간 간의 차이를 나타냅니다. 변경되면 추정기가 센서 데이터를 놓쳤거나 드라이버가 잘못된 통합 간격을 게시함을 의미합니다. 0으로 유지되어야하지만, 비행중 매개 변수 변경에 대해 약간 증가할 수 있으며 일반적으로 문제가 되지는 않습니다.</p><p>이것은 좋은 예입니다.<img src="'+S+'" alt="샘플링 규칙성 양호"></p><p>다음 예는 너무 많은 드롭 아웃이 나타나고 있으며, 이 경우 사용 된 SD 카드의 품질이 좋지 않았습니다. (좋은 SD 카드는 <a href="./../dev_log/logging.html#sd-cards">여기</a> 참조) :</p><p><img src="'+D+'" alt="많은 탈락"></p><h2 id="로그-메시지" tabindex="-1">로그 메시지 <a class="header-anchor" href="#로그-메시지" aria-label="Permalink to &quot;로그 메시지&quot;">​</a></h2><p>시스템 오류와 경고 메시지에 관한 표입니다. 예를 들어 작업이 스택 크기가 낮으면 표시됩니다.</p><p>메시지는 개별적으로 검사하여야 하며, 모든 메시지가 문제를 나타내는 것은 아닙니다. 예를 들어 다음은 kill-switch 테스트를 나타냅니다. <img src="'+w+'" alt="로그 메시지"></p><h2 id="비행-기체-로그-검토-예" tabindex="-1">비행/기체 로그 검토 예 <a class="header-anchor" href="#비행-기체-로그-검토-예" aria-label="Permalink to &quot;비행/기체 로그 검토 예&quot;">​</a></h2><p>기체 상태를 분석시 특정 기체의 여러 그래프를 분석하는 것이 좋습니다 (다른 그래프가 일부 문제를 더 잘 나타낼 수 있음). 이것은 진동 문제를 검토시 특히 중요합니다.</p><p>아래 섹션은 비행/기체별로 몇 가지 (이전에 제시된) 그래프를 그룹화합니다.</p><h3 id="qav-r-5-racer" tabindex="-1">QAV-R 5&quot; Racer <a class="header-anchor" href="#qav-r-5-racer" aria-label="Permalink to &quot;QAV-R 5&quot; Racer&quot;">​</a></h3><p>이 그래프는 모두 <a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">QAV-R 5 &quot;Racer</a>의 동일한 비행에서 가져온 것입니다.</p><p>진동이 매우 낮은 기체임을 나타냅니다.</p><ul><li>액추에이터 제어 FFT는 가장 낮은 끝에서 단일 피크 만 표시하고 나머지는 낮고 평평합니다.</li><li>스펙트럼 밀도는 대부분 녹색이며 저주파에서 약간의 노란색만 있습니다.</li><li>Raw Acceleration에는 x/y 축 트레이스와 잘 분리된 z 축 트레이스가 있습니다.</li></ul><p><img src="'+a+'" alt="저진동 QAV-R 5 Racer - FFT 그래프"></p><p><img src="'+e+'" alt="저진동 QAV-R 5 Racer - 스펙트럼 밀도 플롯"></p><p><img src="'+o+'" alt="저진동 QAV-R 5 Racer - 원시 가속도. 그래프"></p><h3 id="dji-f450" tabindex="-1">DJI F450 <a class="header-anchor" href="#dji-f450" aria-label="Permalink to &quot;DJI F450&quot;">​</a></h3><p>These charts are all from the same flight of a <em>DJI F450</em>.</p><p>진동이 적은 기체임을 나타냅니다 (하지만 위의 QAV-R만큼 낮지는 않습니다!).</p><ul><li>액추에이터 제어 FFT는 가장 낮은 끝에서 피크를 보여줍니다. 약 100Hz (프로펠러의 블레이드 통과 주파수)에서 범프를 제외하고 나머지 대부분은 평평합니다.</li><li>스펙트럼 밀도는 대부분 녹색입니다. 블레이드 통과 주파수가 다시 표시됩니다.</li><li>Raw Acceleration에는 x/y 축 트레이스와 잘 분리된 z 축 트레이스가 있습니다.</li></ul><p><img src="'+t+'" alt="저진동 DJI F450 - FFT 그래프"></p><p><img src="'+l+'" alt="저진동 DJI F450 - 스펙트럼 밀도 플롯"></p><p><img src="'+s+'" alt="저진동 DJI F450 - 원시 가속도 그래프"></p><h3 id="s500" tabindex="-1">S500 <a class="header-anchor" href="#s500" aria-label="Permalink to &quot;S500&quot;">​</a></h3><p>이 차트는 S550의 동일한 비행에서 가져온 것입니다.</p><p>경계선 허용 진동이 있는 기체임을 나타냅니다.</p><ul><li>액추에이터 제어 FFT는 가장 낮은 끝에서 피크를 보여줍니다. 약 100Hz의 범프를 제외하고는, 나머지 대부분은 평평합니다.</li><li>스펙트럼 밀도는 대부분 녹색이지만, 100Hz에서 DJI F450보다 노란색이 더 많습니다.</li><li>Raw Acceleration에는 x/y 축 트레이스에 근접한 z 축 트레이스가 있습니다. 이것은 비행 성능에 부정적인 영향을 미치기 시작하는 한계입니다.</li></ul><p><img src="'+i+'" alt="저진동 S500 액추에이터 컨트롤 - FFT 플롯"></p><p><img src="'+r+'" alt="저진동 S500 - 스펙트럼 밀도 플롯"></p><p><img src="'+p+'" alt="경계선 진동 S500 x, y - 원시 가속도. 그래프"></p>',149),V=[z];function E(L,H,J,M,Q,N){return y(),A("div",null,V)}const B=T(O,[["render",E]]);export{j as __pageData,B as default};
